// @ts-nocheck
const METADATA = {
    website: "https://steamcommunity.com/id/Skrip037/",
    author: "Skrip",
    name: "SkUpdate - Update Notifier",
    version: "0.9.7",
    id: "sk-update",
    description:
        "Checks the version of all compatible mods and displays if there is an update.",

    minimumGameVersion: ">=1.5.0",
    doesNotAffectSavegame: true,
    modId: "1870560",
    api_key: "5cf048938401c69a7e2293a8c4a17afa",

    settings: {
        showOnMainMenu: true, // Show the large buttons on the main menu / Otherwise just show on Mods page and small notification on main menu
        showDirectDownloadLink: true, // Show a direct download link to the update file on the mods Mod page
        debugVerbose: true,
    },
};

// Variables for version checking
var verElement = ""; // Display element
var verInstalledMods = []; // List of installed mods to compare against
var verModIds = []; // Store mod ids separately for optimized compare
var verModsToUpdate = []; // List of mods that need to be updated
var verModLatestVersion = []; // List of latest versions for comparison
var verModLink = []; // List that contains links for mods that need to be updated
var verModFileLink = []; // List that contains links for the mod files that need to be updated
var verResponseLatencyStart = -1; // Store timer for latency measure
///


class Mod extends shapez.Mod {
    init() {
        console.log("(SkUpdate) ==> CHECKING MOD VERSIONS - Sending request");

        verResponseLatencyStart = new Date().getTime(); // Track the time before our request

        // Send the request
        fetch('https://api.mod.io/v1/games/2978/mods' + '?' + 'api_key=' + METADATA.api_key, // Pull all mods
            {
                method: 'GET',
                headers: {
                    'Accept': 'application/json',
                }
            })
            .then(function (res) {
                return res.json();
            }).then(function (body) {
                console.log("(SkUpdate) ==> Response received from mod.io API (" + (new Date().getTime() - verResponseLatencyStart) + "ms) - Processing") // How long did it take to get a response?
                if (METADATA.settings.debugVerbose) { console.log(body); }
                verResponseLatencyStart = new Date().getTime();
                check.allMods(body);
            });

        verInstalledMods.push(this); // This mod doesn't detect itself, because it hasn't completed init() yet. Add it manually.
        verModIds.push(this.metadata.modId.toString()); // Add our id for easy comparison

        if (this.modLoader.mods.length > 0) { // Have other mods been found?
            for (let m = 0; m < this.modLoader.mods.length; m++) { // Process all mods
                var mod = this.modLoader.mods[m];
                if (mod.metadata.modId && mod.metadata.ignoreSkUpdate !== 1) { // Is the mod supported and does not want to be ignored?
                    verInstalledMods.push(mod);
                    verModIds.push(mod.metadata.modId.toString());
                }
            }
        }

        var check = {
            compareVersionNumbers: function (v1, v2) {
                var v1parts = v1.split('.');
                var v2parts = v2.split('.');

                for (var i = 0; i < v1parts.length; ++i) { // Compare each part of the version number. Supports unlimited periods.
                    if (v2parts.length === i) {
                        return 1;
                    }

                    if (v1parts[i] === v2parts[i]) {
                        continue;
                    }
                    if (v1parts[i] > v2parts[i]) {
                        return 1;
                    }
                    return -1;
                }

                if (v1parts.length != v2parts.length) {
                    return -1;
                }

                return 0;
            },
            version: function (v1, v2) { // Return true if update needed. Is v1 > v2?
                try {
                    if (check.compareVersionNumbers(v1, v2) < 0) { // METADATA.version, verLatestVersion
                        return true;
                    }
                    return false;
                }
                catch (error) {
                    console.error(error); // Just throw an error and move on to the next mod. Should only error if corrupted data
                    return false;
                }
            },
            allMods: async function (modJson) {
                try {
                    if (verInstalledMods.length > 0) {
                        for (let i = 0; i < modJson.data.length; i++) { // Loop over all mods
                            var jmod = modJson.data[i];
                            var modIndex = verModIds.indexOf(jmod.id.toString()); // For the mod we are examining, do we have it installed?
                            if (modIndex > -1) { // Yes we do.
                                if (check.version(verInstalledMods[modIndex].metadata.version, jmod.modfile.version)) { // Compare the versions
                                    console.log("(SkUpdate) => \x1b[33m[NEW]\x1b[37m " + verInstalledMods[modIndex].metadata.name + " (" + verInstalledMods[modIndex].metadata.version + ") => (\x1b[32m" + jmod.modfile.version + "\x1b[37m)");
                                    verModsToUpdate.push(verInstalledMods[modIndex]); // Need to update this mod - push data to the arrays (These will be converted to proper objects in a future version of this)
                                    verModLatestVersion.push(jmod.modfile.version);
                                    verModLink.push(jmod.profile_url);
                                    verModFileLink.push(jmod.modfile.download.binary_url);
                                    if (METADATA.settings.debugVerbose) {
                                        console.log("(SkUpdate) Parsed out - Mod: " + verInstalledMods[modIndex].metadata.name + " ID: " + jmod.id.toString() + " Version: " + jmod.modfile.version + " MLink: " + jmod.profile_url
                                            + " DLink: " + jmod.modfile.download.binary_url)
                                    }
                                } else {
                                    console.log("(SkUpdate) => \x1b[32m[UTD]\x1b[37m " + verInstalledMods[modIndex].metadata.name + " (" + verInstalledMods[modIndex].metadata.version + ") => (" + jmod.modfile.version + ")");
                                }
                            }
                        }
                    }
                }
                catch (error) {
                    console.error(error);
                }
                finally {
                    console.log("(SkUpdate) => Processing complete (" + (new Date().getTime() - verResponseLatencyStart) + "ms).");
                }
            },
        }

        this.signals.stateEntered.add(state => {
            if (state.key === "MainMenuState") {
                if (verModsToUpdate.length > 0) {
                    if (METADATA.settings.showOnMainMenu) {
                        var parent = document.querySelector("#state_MainMenuState > div.mainWrapper");
                        parent.style.cssText += 'grid-row-gap:calc(3px*var(--ui-scale));';

                        verElement = document.createElement("div");
                        verElement.id = "sk_upd_note_centered" // centered

                        var skuImg = document.createElement("img");
                        skuImg.style.cssText += 'width:calc(100px*var(--ui-scale))';
                        skuImg.setAttribute("src", RESOURCES.sku.banner);
                        verElement.appendChild(skuImg);

                        parent.appendChild(verElement);

                        for (let i = 0; i < verModsToUpdate.length; i++) {
                            verElement = document.createElement("div");
                            var curMod = verModsToUpdate[i];
                            if (verModsToUpdate.length > 3) {
                                if (i % 2 == 0) { // Is the index even or odd? (should it go on the left or right?). Place all on right unless more than 3 mods.
                                    verElement.id = "sk_upd_note_left"; // even
                                } else {
                                    verElement.id = "sk_upd_note_right"; // odd
                                }
                            } else {
                                verElement.id = "sk_upd_note_centered" // centered
                            }

                            parent.appendChild(verElement);

                            const button = document.createElement("button");
                            button.classList.add("styledButton");
                            if (curMod.metadata.name.length <= 26) {
                                button.innerText = "Version (" + verModLatestVersion[i] + ") is available for " + curMod.metadata.name + " (" + curMod.metadata.version + ")";
                            } else {
                                button.innerText = "Version (" + verModLatestVersion[i] + ") is available for " + curMod.metadata.name.substring(0, 26) + "... (" + curMod.metadata.version + ")";
                            }
                            button.addEventListener("click", () => {
                                this.app.platformWrapper.openExternalLink(verModLink[i]);
                            });
                            verElement.appendChild(button);
                        }
                    } else {
                        var parent = document.querySelector("#state_MainMenuState > div.mainWrapper > div.modsOverview");
                        var utdImg = document.createElement("img");
                        utdImg.style.cssText += 'width:calc(100px*var(--ui-scale))';
                        utdImg.style.cssText += 'padding-top:3px';
                        utdImg.setAttribute("src", RESOURCES.ind.new);
                        parent.appendChild(utdImg);
                    }
                } else {
                    var parent = document.querySelector("#state_MainMenuState > div.mainWrapper > div.modsOverview");
                    var utdImg = document.createElement("img");
                    utdImg.style.cssText += 'width:calc(100px*var(--ui-scale))';
                    utdImg.style.cssText += 'padding-top:3px';
                    utdImg.setAttribute("src", RESOURCES.sku.utd);
                    parent.appendChild(utdImg);
                }
            }

            if (state.key === "ModsState") {
                if (this.modLoader.mods.length > 0) { // Have other mods been found?
                    var parentList = document.querySelectorAll('#state_ModsState > div.container > div > div.modsList > div.mod')
                    for (let i = 0; i < parentList.length; i++) { // For each mod in the list..
                        //parentList[i].style.cssText += 'grid-row-gap:0;'; // No longer needed, our objects are all contained on one row now

                        var installedModIndex = -1;
                        //Locate the mod found in the html list within the mod loader objects
                        if (verInstalledMods.length > 0) {
                            for (let m = 0; m < verInstalledMods.length; m++) {
                                try {
                                    if (verInstalledMods[m].metadata.name === parentList[i].childNodes[0].innerText.split("\n")[0]) { // Does the name in the list match any of our compatible mods?
                                        installedModIndex = m;
                                        break;
                                    }
                                } catch (error) {
                                    continue;
                                }
                            }
                        }

                        var utdImg = document.createElement("img");
                        utdImg.id = "sk_upd_mod_utd";
                        utdImg.style.cssText += 'width:calc(100px*var(--ui-scale))';
                        utdImg.style.cssText += 'padding-top:3px';

                        if (installedModIndex >= 0) { // Is the mod compatible?
                            var mtuList = verModsToUpdate.indexOf(verInstalledMods[installedModIndex]);
                            if (mtuList > -1) { // Does it need to be updated?
                                utdImg.setAttribute("src", RESOURCES.ind.new); // Yes it is compatible, yes it needs updated

                                if (verModLatestVersion[mtuList]) {
                                    parentList[i].childNodes[1].innerText += " (" + verModLatestVersion[mtuList] + ")";
                                    if (METADATA.settings.debugVerbose) {
                                        console.log("(SkUpdate) Mod Found: (" + installedModIndex + ") Version:" + verModLatestVersion[mtuList]
                                            + " MLink: " + verModLink[installedModIndex] + " DLink: " + verModFileLink[mtuList]);
                                    }
                                }

                                if (METADATA.settings.debugVerbose) { console.log(verModLink[mtuList]); }
                                if (!parentList[i].childNodes[0].innerHTML.includes("mod.io") && verModLink[mtuList]) { // Are they already linking to the mod.io? And we received the link?
                                    //Doesn't seem so. Generate update link
                                    var modLink = document.createElement("a");
                                    var modLinkText = document.createTextNode("Mod.io Link");
                                    modLink.setAttribute("href", verModLink[mtuList]);
                                    modLink.setAttribute("class", "website");
                                    modLink.setAttribute("target", "_blank");
                                    modLink.appendChild(modLinkText);
                                    parentList[i].childNodes[0].appendChild(modLink);
                                }
                                if (METADATA.settings.debugVerbose) { console.log(verModFileLink[mtuList]); }

                                if (METADATA.settings.showDirectDownloadLink && verModFileLink[mtuList]) { // Show a direct download link if indicated and we received it
                                    var modUpdLink = document.createElement("a");
                                    var modUpdLinkText = document.createTextNode("(Direct Download) Update Link");
                                    modUpdLink.setAttribute("href", verModFileLink[mtuList]);
                                    modUpdLink.setAttribute("class", "website");
                                    modUpdLink.setAttribute("target", "_blank");
                                    modUpdLink.appendChild(modUpdLinkText);
                                    parentList[i].childNodes[0].appendChild(modUpdLink);
                                }
                            } else {
                                utdImg.setAttribute("src", RESOURCES.ind.ready); // Yes it is compatible, no it does not need to be updated
                            }
                        } else {
                            utdImg.setAttribute("src", RESOURCES.ind.nc); // No it is not compatible
                        }
                        parentList[i].childNodes[1].appendChild(utdImg);
                    }
                }
            }
        });

        this.modInterface.registerCss(`
                #sk_upd_note_right {
                    z-index: 0;
                    display: block;
                    grid-column: 2;
                }
                #sk_upd_note_centered {
                    z-index: 0;
                    display: block;
                    grid-column: 1 / 3;
                }
                #sk_upd_note_left {
                    z-index: 0;
                    display: block;
                    grid-column: 1;
                }
                #sk_upd_mod_utd {
                    z-index: 0;
                    display: block;
                    grid-column: 2;
                }
            `);


    }
}

const RESOURCES = {
    sku: {
        banner: "data:image/png;base64,",
        utd: "data:image/png;base64,",
    },
    ind: {
        ready: "data:image/png;base64,",
        new: "data:image/png;base64,",
        nc: "data:image/png;base64,",
    },
};